import React from "react";
import { Link } from "react-router-dom";

const NotFound = () => {

    return(
    <div className="text-white text-3xl text-center">
        <h1>404- Not Found</h1>
        <Link to="/">
            Go home
        </Link>
    </div>
    );
};

export default NotFound;
